  `openId` varchar(128) NOT NULL,
  PRIMARY KEY (`autoid`),
  KEY `account` (`account`),
  KEY `belongto` (`belongto`),
  KEY `openId` (`openId`),
  CONSTRAINT `mam_ibfk_1` FOREIGN KEY (`openId`) REFERENCES `open` (`openId`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8;

