DROP TABLE IF EXISTS `md_log`;
CREATE TABLE `md_log` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '操作码-对应dict表',
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '操作说明',
  `url` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '访问链接-对应菜单表url',
  `ip` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '请求客户端IP',
  `table` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '修改表格',
  `data_id` int(11) DEFAULT NULL COMMENT '数据ID',
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '新增时间',
  `deleted_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '最后更改时间',
  `created_user` int(11) DEFAULT NULL COMMENT '添加人',
  `old` text COLLATE utf8_unicode_ci COMMENT '旧字段',
  `new` text COLLATE utf8_unicode_ci COMMENT '新字段',
  PRIMARY KEY (`id`),
  KEY `操作人` (`created_user`) USING BTREE,
  KEY `操作码以及操作的数据表` (`code`,`table`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

-- ----------------------------
-- Records of md_log
-- ----------------------------

-- ----------------------------
-- Table structure for md_menus
-- ----------------------------
DROP TABLE IF EXISTS `md_menus`;
CREATE TABLE `md_menus` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pid` int(11) DEFAULT '0' COMMENT '父级菜单-对应本表ID',
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '菜单名称',
  `url` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '菜单地址',
  `flag` varchar(50) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '菜单图标',
  `type` int(11) DEFAULT '1001001' COMMENT '对应角色-对应系统参数表-1001 ',
  `is_menu` tinyint(2) DEFAULT '0' COMMENT '是否为左侧菜单链接-0按钮事件 1菜单链接,会显示在左侧列表',
  `is_open` tinyint(2) DEFAULT '1' COMMENT '是否开通-1开通 2禁用  考虑到后期客户套餐的维护',
  `sort` int(11) DEFAULT '0' COMMENT '菜单排序',
  `level` tinyint(3) unsigned DEFAULT '0' COMMENT '菜单级别',
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '新增时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '是否删除-如果是删除 此时间就是删除时间',
  `created_user` int(11) DEFAULT '0' COMMENT '添加人-对应user表ID ',
  PRIMARY KEY (`id`),
  KEY `用户索引` (`created_user`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of md_menus
-- ----------------------------

-- ----------------------------
-- Table structure for md_open_list
-- ----------------------------
DROP TABLE IF EXISTS `md_open_list`;
CREATE TABLE `md_open_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `openId` varchar(125) NOT NULL,
  `nickname` varchar(20) DEFAULT NULL,
  `sex` tinyint(1) DEFAULT NULL COMMENT '值为1时是男性，值为2时是女性，值为0时是未知',
  `city` varchar(10) DEFAULT NULL,
  `country` varchar(10) DEFAULT NULL,
  `province` varchar(20) DEFAULT NULL,
  `language` varchar(15) DEFAULT NULL,
  `headimgurl` varchar(255) DEFAULT NULL,
  `subscribe_time` varchar(20) DEFAULT NULL COMMENT '用户关注时间，为时间戳。如果用户曾多次关注，则取最后关注时间',
  `unionid` int(11) DEFAULT NULL,
  `remark` varchar(10) DEFAULT NULL COMMENT '众号运营者对粉丝的备注',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of md_open_list
-- ----------------------------

-- ----------------------------
-- Table structure for md_order
-- ----------------------------
DROP TABLE IF EXISTS `md_order`;
CREATE TABLE `md_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tradeNumber` varchar(100) DEFAULT NULL COMMENT '唯一订单编号',
  `payType` int(11) DEFAULT '1' COMMENT '支付方式-1支付宝2微信',
  `userId` int(11) DEFAULT NULL COMMENT '购买用户-对应user表ID',
  `addressId` int(11) DEFAULT NULL COMMENT '收货地址-对应address表ID',
  `product` varchar(255) DEFAULT NULL COMMENT '购买商品信息-表数据',
  `desc` varchar(255) DEFAULT NULL COMMENT '购买商品信息-文字描述',
  `total` decimal(10,2) DEFAULT NULL COMMENT '订单总额',
  `status` tinyint(4) DEFAULT '0' COMMENT '支付状态-0未支付1支付成功',
  `progress` int(11) DEFAULT '0' COMMENT '订单状态-0未支付1代发货2已经发货3订单完成4取消订单',
  `expressId` int(11) DEFAULT NULL COMMENT '物流公司',
  `expressCode` varchar(255) DEFAULT NULL COMMENT '物流单号',
  `created_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_user` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `progress` (`progress`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=44 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of md_order
-- ----------------------------

